const services = [
  {
    id: 1,
    clase: "icon1 icon-size-wide",
    title: "Trial Lesson",
    meetingType: "Hola, me gustaria agendar un -trial lesson-",
    body: `Meet your teacher and review your current level of Spanish, tell us what your Spanish goal is and how much time you have available to reach it. Together we will create a plan to help you reach your goal!`,
    detalles: `A free level evaluation and personalized proposal for learning can be the first step.`,
  },  
  {
    id: 2,
    clase:"icon2",
    title: "One-on-one classes",
    meetingType: "Hola, me gustaria agendar un -one on one lesson-",
    body: "One-on-one classes last 60 minutes in which you can focus your learning on the skill you are most interested in developing: Speaking, Listening, Writing, Reading and Grammar.",
    detalles: "They can be two hours if you prefer it that way.",
  },
  {
    id: 3,
    clase:"icon3",
    title: "Group classes by level",
    meetingType: "Hola, me gustaria agendar un -group class lesson-",
    body: "Share learning with peers of the same level and learn in the company of the community (maximum 5 students per level). Starts every 2 months.",
    detalles: [],
  },
  {
    id: 4,
    clase:"icon1 icon-size-wide",
    title: "Conversational group classes by level",
    meetingType: "Hola, me gustaria agendar un - conversational group class lesson-",
    body: "Apply the knowledge acquired and practice vocabulary in an immersive environment by doing conversation exercises with the best colleagues.",
    detalles: [],
  },
];

export default services;
